    false,nt"url": null,nt"notes": "This annual narrative report for Parker
    River National Wildlife Refuge summarizes refuge activities during 1998. The report
    begins with information about the yearu2019s highlights and climatic conditions.
    Land acquisition- including fee title- is also covered. The report includes a planning
    section which discusses the master plan, the management plan, public participation,
    compliance with Environmental Resource Mandates, and research/investigations. Refuge
    administration is outlined; lists of personnel, volunteer programs, and funding
    sources are given. Habitat management is also covered. Subjects include wetlands,
    grasslands, haying, fire management, and pest control. The wildlife section of the
    report discusses wildlife diversity, endangered/threatened species, waterfowl, marsh/water
    birds, shorebirds, raptors, game animals, animal control, and marking/banding. The
    public uses of the refuge described in this report include general use, outdoor
    classrooms, interpretive foot trails, tours, hunting, fishing, camping, picnicking,
    and wildlife observation. The equipment and facilities section of the report provides
    information about new construction, rehabilitation, major maintenance, equipment
    replacement, and communication systems.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
